var tipuesearch = {"pages": [{'title': '簡介', 'text': '四設計二甲-40823108-高宇哲 \n 倉儲:\xa0 cad2020倉儲 \n Youtube:\xa0 鯊魚先生 \n \n \n', 'tags': '', 'url': '簡介.html'}, {'title': '期中課堂內容', 'text': '參考 亂數分組 , 分成四組 \n Group4 \n Leader : \n Repository:\xa0 40823112\xa0 | \xa0Site:\xa0 40823112 \n Member: \n Repository:\xa0 40823102| \xa0Site:\xa0 40823102 \n Repository:\xa0 40823106 \xa0 | \xa0Site:\xa0 40823106 \n Repository:\xa0 40823108 \xa0 | \xa0Site:\xa0 40823108 \n Repository:\xa0 40823115 \xa0 | \xa0Site:\xa0 40823115 \n Repository:\xa0 40823120 \xa0 | \xa0Site:\xa0 40823120 \n Repository:\xa0 40823135 \xa0 | \xa0Site:\xa0 40823135 \n Repository:\xa0 40823140 \xa0 | \xa0Site:\xa0 40823140 \n Repository:\xa0 40823142 \xa0 | \xa0Site:\xa0 40823142 \n Repository:\xa0 40823146 \xa0 | \xa0Site:\xa0 40823146 \n Repository:\xa0 40823148 \xa0 | \xa0Site:\xa0 40823148 \n Repository:\xa0 40823151 \xa0 | \xa0Site:\xa0 40823151 \n', 'tags': '', 'url': '期中課堂內容.html'}, {'title': 'w1', 'text': '如何使用cmsimde建立網站: \n 參考:\xa0 wcm2020 \n Step1: \n 下載 fall2020_cp.7 壓縮檔 ,解壓縮檔 \n 再到google搜尋git windows,下載 64-bit Git for Windows Portable. , 解壓縮並放入PortableGit資料夾中 \n Step2: \n 將start放入(Untitled)-SciTE並修改start路徑 ,如下圖 \n \n Step3: \n 設定gitconfig ,並將此檔案存入home的目錄下 \n \n \n 儲存後重啟start \n Step4: \n 先到自己的github建立倉儲,倉儲名稱自行命名 \n \n Step5: \n 到github網站git clone自己倉儲的網址,clone完後git submodule add \n \n \n Step6: \n 把子模組cmsimde放到網頁資料夾後,進入up_ir資料夾 \n \n Step7: \n 把所有資料複製出 \n \n Step8: \n cad2020的目錄下 \n \n Step9: \n 安裝\xa0 pip install flask flask_cors bs4 markdown pelicon leo \n Step10: \n 進入cmsimde目錄下 ,python wsgi.py開啟動態網頁 \n \n Step11: \n 到google搜尋localhost9443 ,點選進階-->仍要前往 \n Step12: \n 輸入密碼進入 \n Step13: \n 到cmd將 所有東西推送 \n 步驟為: \n 1.tmp-->cad2020 \n 2.git add . \n 3.git commit -m "修改內容" \n 4.git push \n 5.輸入學號 ,密碼 \n 6.成功建立網站 \n', 'tags': '', 'url': 'w1.html'}, {'title': '各零件體積-1', 'text': '參考 Solidworks 零件繪圖練習1.pdf 建立所有零件檔 , 使用Inventor2020,與Solidworks2016 \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': '各零件體積-1.html'}, {'title': 'Inventor-1', 'text': '圖檔 Inventor2020圖檔 \n 表格 \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'Inventor-1.html'}, {'title': 'Solidworks-1', 'text': '圖檔 \n 表格 \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'Solidworks-1.html'}, {'title': 'W2', 'text': '使用Inventor 2020, 下載於 Autodesk \n Inventor版本類型 \n \n Inventor授權類型 \n \n 零件繪圖練習1繪製過程1-50題 \n \n 零件繪圖練習2繪製過程 \n Tutorial 1 Exercises: \n 1-1、1-2、1-3、1-4 \n \n \n \n Tutorial 2 Exercises : \n 2-1、2-2、2-3、2-4、2-5、2-6、2-7、3-1、3-2 \n \n \n Tutorial 3 Exercises: \n 3-3、3-4、3-5、3-6、3-7、3-8、3-9、3-10、3-11、3-12、3-13、3-14、3-15、3-16、3-17、3-18、3-19、3-20、3-21、3-22 \n \n \n Tutorial 4 Exercises: \n 4-1、4-2、4-3、4-4、4-5、4-6a、4-6b、4-7 \n \n \n Tutorial 5 Exercises: \n 5-1、5-2、5-3、5-4、5-5、5-6、5-7、5-8、5-9、5-10、5-11、5-12、5-13、5-14、5-15 \n \n', 'tags': '', 'url': 'W2.html'}, {'title': 'Inventor-2', 'text': '參考 Solidworks 零件繪圖練習2.pdf 建立所有零件檔 , 使用Inventor2020 \n 繪製過程播放清單: 繪製過程 \n \n', 'tags': '', 'url': 'Inventor-2.html'}, {'title': 'W3', 'text': '國定假日中秋節放假 \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '開始實施每周互評自評,\xa0 電腦輔助設計實習自評與互評表單 \n 選出組長 \n 參考 亂數分組 , 分成四組 \n Group4 \n Leader : \n Repository:  40823112  |  Site:  40823112 \n Member: \n Repository:  40823102|  Site:  40823102 \n Repository:  40823106   |  Site:  40823106 \n Repository:  40823108   |  Site:  40823108 \n Repository:  40823115   |  Site:  40823115 \n Repository:  40823120   |  Site:  40823120 \n Repository:  40823135   |  Site:  40823135 \n Repository:  40823140   |  Site:  40823140 \n Repository:  40823142   |  Site:  40823142 \n Repository:  40823146   |  Site:  40823146 \n Repository:  40823148   |  Site:  40823148 \n Repository:  40823151   |  Site:  40823151 \n', 'tags': '', 'url': 'W4.html'}, {'title': 'Wink 3使用', 'text': '下載 Wink 3 \n 開啟Wink 3 \n \n 使用過程\xa0 Wink 3功能介紹與使用 \n \n Wink螢幕錄製 \n \n Wink專案儲存 \n \n', 'tags': '', 'url': 'Wink 3使用.html'}, {'title': 'W5', 'text': '什麼是API \n 在電腦程式設計裡, 它屬於應用程式介面(API)是人與機械-物品-軟體之間溝通的橋樑 \n ex:我想使用手機開啟Youtube觀看影片 \n \xa0 \xa0 指令:讓手機開啟Youtube執行我需要的事件 \n \xa0 \xa0 介面:手機 \n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '如何使用API控制Solidworks與Inevntor繪製模型, 並同時將各模型之體積與圖片匯入.html檔, 使其能在網頁中瀏覽各模型之變化 \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '利用SciTE編輯器類解譯ANSI C程式並, 建立ANSI C程式環境 \n 下載 cad2020_w7_tcc_gnuplot.7z 解壓縮至自己的資料夾 \n \n 將gnuplot, tcc資料夾, wqy-microhei.tcc文字檔剪下-->data資料夾下與tmp同層 \n \n 修改start.abt路徑 \n \n set path_git=%Disk%:\\Portablegit\\PortableGit\\bin;\nset path_tcc=%Disk%:\\tcc\\;\nset path_gnuplot=%Disk%:\\gnuplot\\bin;\n\npath=%Disk%:;%path_python%;%path_git%;%path_tcc%;%path_gnuplot%; \n 使用 下載的 cad2020_w7_tcc_gnuplot.7z 裡的wscite資料夾將cpp.properties批次檔複製出 \n \n 放置fall2020/cad2020/data/wscite下覆蓋原有的 cpp.properties批次檔 \n \n 即可執行下列程式 \n \n \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '下載 Pyslvs_UI \xa0,\xa0 用參數來畫圖代替手繪 Pyslvs 使用手冊 \n Pyslvs連桿機構應用 \n \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '期中考週 , 到課打分數 \n', 'tags': '', 'url': 'W9.html'}, {'title': 'Inventor API', 'text': '此為參考 Solidworks 零件繪圖練習1.pdf 所繪製的零件, 透過編輯器更改所需的尺寸, 有64種變化 \n \n', 'tags': '', 'url': 'Inventor API.html'}, {'title': '參數', 'text': 'Inventor 在建立零件與組合模型的過程中會帶入許多"參數" \n \n 這些參數在模型檔案中會被整合在"參數表中", 如下圖: \n \n \n 如上圖, 有各種參數屬性, 以下逐項介紹: \n 模型參數: \n 為使用者在繪製物件時所自動加入的參數 \n 模型參數從d0~dn項, 都是在建立幾何的過程中Inventor自動產生的 \n 使用者參數: \n 為使用自行加入的條件與尺寸或者方程式 \n 使用者: \n 會列出影響到參數的幾何-約束-特徵-草圖等等, 除非該指令無影響到參數 \n 單位類型: \n 在"模型參數"中，Inventor 會自動根據使用者使用的尺寸標註方式選擇長度 (mm) 或者是角度 (deg) 單位，另外會用到如配合陣列數量的無單位(ul) 單位類型如下: \n \n 方程式: \n 最常使用的就是直接將"常數"填入使其做計算,也可以直接鍵入方程式, 最後由標稱值欄位顯示結果 \n 標稱值: \n 如果方程式欄位中為"常數"此欄會直接顯示常數 如果方程式欄位中為"方程式"此欄會將方程式做計算最後顯示結果 \n 公差: \n 紅色"負號"表示使用下限作為模型值 藍色"加號"表示使用上限作為模型值 綠色"三角"表示用中間值作為模型值 黃色"圓環"表示用標稱值作為模型值 \n 模型值: \n 標稱值加上公差設定的計算結果, 惠珍的套用到模型中改變尺寸 \n 註釋: \n 可以加上參數的用途說明 \n', 'tags': '', 'url': '參數.html'}, {'title': 'ilogic Basic', 'text': '參數與表單: \n 使用Inventor iLogic可以從"參數指定"這個方向來看, 在功能表上的"Fx"字樣的按鈕點選進入"參數表", 如下圖: \n \n \n \n iLogic功能是透過簡單的參數指定語法來快速連結資料, 可以讓組合中的不同元件的幾何特徵參數產生關聯, 為了方便操作可以自訂表單用來調整與顯示控制 \n \n 要進行iLogic前要先定義好需要的關鍵尺寸：長 、寬 、高，三個尺寸條件， 可以在既有的最上層組合中用英文或中文定義名稱，如下圖示： \n 要呼叫出iLogic功能，請點選"管理" - "iLogic" - "iLogic瀏覽器"，如上圖示： \n \n 在原本的瀏覽器旁邊就會出現"iLogic"瀏覽器, 如下圖: \n 下方紅框處就是編譯模型鍵入程式碼的區域, 瀏覽器中的選項皆為程式碼點選後即可鍵入, 變數和名稱需自行更改 \n \n 表單是為了方便使用者快速更改, 如下圖: \n \n 將所需資料拖入右方"標示"瀏覽器中, 即可生成表單, 表單可以自行定義樣式於下方工具箱與性質瀏覽器中做更改與修正 \n', 'tags': '', 'url': 'ilogic Basic.html'}, {'title': 'iLogic程式基礎概念', 'text': 'If Then ElseIf 跟 Case Select Case \n 請參考 Inventor 20121 說明: 關於iLogic中的條件陳述式 \n 以下為iLogic應用 \n Fx參數: \n \n iLogic規則 \n \n', 'tags': '', 'url': 'iLogic程式基礎概念.html'}, {'title': '應用', 'text': '參考 Solidworks 零件繪圖練習1.pdf , 繪製Lesson1 \n \n 到DartPad編譯, 使用大一上"計算機程式"課程所教 " for 迴圈" \n \n 純Dart程式 \n int s = 1;\nint i;\nint start = 1;\nint end = 64;\nint sum;\nint L = 80;\nint W = 30;\nint H = 40;\nint d3 = 0;\nint d12 = 10;\nmain() {\n  sum = 0;\n  for (i = start; i <= end; i++) {\n    L = L + 5;\n    W = W + 5;\n    H = H + 5;\n    s = s + 1;\n    d3 = d3 + 0;\n    d12 = d12 + 5;\n    print("If Style = $s Then \\n Leight = $L");\n    print("Width = $W \\n Height = $H");\n    print("d3 = $d3 \\n d12 = $d12");\n    print(\n        "volume = iProperties.Volume \\n Volume = volume \\n Parameter.UpdateAfterChange = True");\n    print("End If");\n  }\n  return 0;\n} \n 將結果複製出, 放入iLogic規則中 \n \n iLogic程式 \n If Style = 2 Then \n Leight = 85\nWidth = 35 \n Height = 45\nd3 = 0 \n d12 = 15\nvolume = iProperties.Volume \n Volume = volume \n Parameter.UpdateAfterChange = True\nEnd If \n 即可使用表單編輯 \n \n \n', 'tags': '', 'url': '應用.html'}, {'title': '期末課堂內容', 'text': '', 'tags': '', 'url': '期末課堂內容.html'}, {'title': 'W10', 'text': '下載 coppeliasim , 並以組為單位設計出一組機構, 可先在solidworks和inventor繪製完機構圖, 再放到coppeliasim進行模擬, 由於載下來的 coppeliasim裡缺少vcruntime140_1, 須從隨身系統裡的Python38資料夾下複製一份vcruntime140_1才能使coppeliasim正常使用 \n \n 每小組每周都要進行 Google Meet , 並討論接下來一個月要開發何種機構 \n', 'tags': '', 'url': 'W10.html'}, {'title': '每周會議紀錄', 'text': '', 'tags': '', 'url': '每周會議紀錄.html'}, {'title': 'W10 Meeting', 'text': '會議記錄 \n \n 使用gitter並記錄Meeting討論過程 \n', 'tags': '', 'url': 'W10 Meeting.html'}]};